    <>
        <div>
            <div>
                <h2 className='text-red-700'>hello</h2>
            </div>
            <h2 className='text-[15px] text-[pink] font-bold text-2xl font-semibold bg-green-900 backdrop-opacity-85	'>Hello, i'm krupali</h2>
        </div>
    </>
  )
}
